"strings"
)
type CustomProcessor string
func(cp CustomProcessor) Process(line string) (string, error) {
cols := strings.Split(line, ",")
if len(cols) <= 5 {
return "",nil
}
return cols[0] + "," + cols[2] + "," + cols[3] + "," + strings.Replace(cols[5], ".", "-", -1)+"\n",nil
}
